  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115196 includes biological
  and fish examination data collected aboard NOAA Ship JOHN N. COBB during cruises
  SECM, jc0009, jc0012, jc0016, jc0018, jc0105, jc0109, jc0113, jc0116, jc0118, jc0209,
  jc0213, jc0216, jc0304b, jc0305, jc0308, jc0310, jc0312, jc0406, jc0408, jc0411,
  jc0414, jc0508, jc0510, jc0512, jc0608, jc0611, jc0613, jc9706, jc9709, jc9711,
  jc9714, jc9717, jc9805, jc9808, jc9811, jc9815, jc9818, jc9906, jc9909, jc9912,
  jc9915 and jc9918 in the Coastal Waters of SE Alaska, Gulf of Alaska and North Pacific
  Ocean from 1997-05-21 to 2006-07-31. These data include SPECIES IDENTIFICATION -
  ORGANISM LENGTH, HABITAT, STOMACH CONTENTS - FULLNESS, STOMACH CONTENTS - CONTENT
  WEIGHT, STOMACH CONTENTS - PREY COUNT, SPECIES IDENTIFICATION and SPECIES IDENTIFICATION
  - WET WEIGHT. The instruments used to collect these data include thermosalinographs,
  CTD, radiometer and trawl. These data were collected by Alex C Wertheimer, Emily
  A Fergusson, Joseph A Orsi and Molly V Sturdevant of National Oceanic and Atmospheric
  Administration - Alaska Fisheries Science Center as part of NEP. The Biological
  and Chemical Oceanography Data Management Office (BCO-DMO) submitted these data
  to NODC on 2013-10-31.nnThe following is the text of the abstract provided by BCO-DMO:nnThis
  coastal monitoring study in the northern region of southeastern Alaska, known as
  the Southeast Coastal Monitoring Project (SECM), was initiated in 1997 and repeated
  from 1998 to 2006 (Orsi et al. 1997, 1998, 2000, 2001, 2002) to develop our understanding
  of the relationships between annual time series of biophysical data and stock-specific
  information.nData was collected in conjunction with juvenile salmon studies in the
  Gulf of Alaska from 1997-2006 by the Southeast Coastal Monitoring Project.\",\n\t\"license_title\":
